import React from "react";

const Menu = () => {
    return (
        <div>
           <header className={"Header"}>
               <div className={"information"}>
                   <u className={"registration"}> Регистрация</u>
                   <u className={"avtorization"}> Авторизация</u>
               </div>
               <image className={"imgWindow"}/>
               <div className={"wrappers"}>
            </div>
           </header>
        </div>
    );
};

export default Menu;
